import React from "react"

const Heading = ({ subtitle, title }) => {
  return (
    <>
      <div id='heading'>
        <h3>{subtitle} </h3>
        <h1>
          {title}
        </h1>
        <h1>BENCANA ALAM</h1>
      </div>
    </>
  )
}

export default Heading
